By linking your Group to your Facebook Group, updates from your Group will also be published on your Facebook Group. Additionally, the Facebook Like Box for your Facebook Group will be displayed on your Group, thus enabling you to gain Likes for your Facebook Group from this website. This Like Box will also:<br /><br /><ol style='margin-left: 20px;
'><li> Show the recent posts from your Facebook Group.</li><li>Show how many 
people already like your Facebook Group.</li> <li>Enable people to Like your Facebook Group.</li></ol><br /> <br /> Enter the URL of your Facebook Group below to link it with this Group.
